INSERT INTO `tbl_product_category` VALUES ('302', '1', '', '231', 'Congratulation Arch', 'images/category/302.jpg', 'Lively and attractive, Humming&#39;s blooming balloon arches deliver the most triumphant good wishes at every Grand Opening!', '1', '50', '0');
INSERT INTO `tbl_product_category` VALUES ('303', '1', '', '231', 'Box Stands', 'images/category/303.jpg', 'Send your heartiest congratulations and warmest well wishes with this outstanding range of box stands.', '1', '50', '0');
INSERT INTO `tbl_product_category` VALUES ('304', '1', '', '231', 'Cheers!', 'images/category/304.jpg', 'Send congratulatory messages in this classy choice of fabric celebration stands together with the finest wines.', '1', '50', '0');
INSERT INTO `tbl_product_category` VALUES ('305', '1', '', '231', 'Celebration Metal Stands', 'images/category/305.jpg', 'A traditional form of congratulatory floral stands, the metal stands relay your heartiest congratulations on a Grand Opening!', '1', '50', '0');
INSERT INTO `tbl_product_category` VALUES ('306', '1', '', '233', 'Vitality Delicacies', 'images/category/306.jpg', 'A gift of nourishing vitality delicacies is always a welcomed excellent choice for anyone who appreciates traditional herbs and essences.', '1', '50', '0');
INSERT INTO `tbl_product_category` VALUES ('307', '1', '', '236', 'Metal Stands & Pedestals', 'images/category/307.jpg', 'Metal stand is a choice option for conveying condolences. With a wide range of flowers and designs, salute the honour and remembrance of the beloved departed.\r\n\r\nPresent your deepest sympathies in a new way using grand sympathy pedestals, a worthy tribute for one greatly respected.', '1', '50', '0');
INSERT INTO `tbl_product_category` VALUES ('308', '1', '', '236', 'Crosses', 'images/category/308.jpg', 'To many Christians crosses give comfort and lend strength during this season of mourning.', '1', '50', '0');
INSERT INTO `tbl_product_category` VALUES ('309', '1', '', '236', 'Coffin Top Sprays & Table Arrangements', 'images/category/309.jpg', 'Designed to adorn coffin top, the delicate floral arrangement is a comforting sight for the family and friends.\r\n\r\nThese elegantly table arrangements are designed to grace the altar and reception tables.', '1', '50', '0');
INSERT INTO `tbl_product_category` VALUES ('310', '1', '', '236', 'Box Stands', 'images/category/310.jpg', '.Laser Crafted\r\n.Wallpaper Print\r\n.Fabric', '1', '50', '0');
INSERT INTO `tbl_product_category` VALUES ('311', '1', '', '236', 'Wreath Ring', 'images/category/311.jpg', 'Wreath ring is a time-honoured choice for conveying one&#39;s deepest sympathies.', '1', '50', '0');
INSERT INTO `tbl_product_category` VALUES ('312', '1', '', '236', 'Blanket Floral Stands', 'images/category/312.jpg', 'Deliver comfort to the bereaved family in the form of blanket floral stands.', '1', '50', '0');
INSERT INTO `tbl_product_category` VALUES ('313', '1', '', '231', 'Auspicious Chinese Painting & Calligraphy', 'images/category/313.jpg', 'Personalize skillfully hand-painted fine art pieces. No two pieces are alike!', '1', '50', '0');
